import React from "react";
import AddIcon from "@mui/icons-material/Add";

function Input() {
    

  return (
    <div className="input">
      <div>
        <input type="text" name="title" placeholder="Enter title" />
        <input type="text" name="content" placeholder="Enter content" />
      </div>
      <button>
        <AddIcon />
      </button>
    </div>
  );
}

export default Input;
